import React from 'react';
import './Dashboard.css';
import MainNavbar from './MainNavbar';
import UploadMenu from './UploadMenu';
import Container from 'react-bootstrap/Container';
import Row from 'react-bootstrap/Row';
import Col from 'react-bootstrap/Col';
import APIMenu from './APIMenu';
import UploadStatusPie from './UploadStatusPie';
import StatusCard from './StatusTable';
import SystemLogCard from './SystemLogCard';

const Dashboard = () => {


    return(
        <React.Fragment className="dashboard">
            <Container fluid>
            <Row className="justify-content-md-left" style={{ 'padding': '40px'}}>
                <MainNavbar/>
            </Row>
                <Row>
                    <Col sm={4}></Col>
                    <Col>
                        <UploadMenu />
                        {/* <APIMenu/> */}
                    </Col>
                    <Col sm={4}></Col>
                </Row>
                <Row>
                    <UploadStatusPie/>
                </Row>
                <Row>
                    <Col xs={4} sm={4} md={4} lg={4}>
                        <StatusCard/>
                    </Col>
                    <Col xs={8} sm={8} md={8} lg={8}>
                        <SystemLogCard/>
                    </Col>
                </Row>
            </Container>
        </React.Fragment>
    );
}

export default Dashboard;
